post_text:
Elementary Secretary Opportunity!
Centennial Public School is accepting applications for our Elementary Secretary position due to retirement. We are looking for a dynamic person that loves kids, has great people skills and good computer skills. The successful candidates starting date is flexible.
Qualified applicants should request an application and mail or email the completed application, 1 letter of reference and updated resume to: Ken Booth, Elementary Principal; Centennial Public School;
P.O. Box 187; Utica, NE 68456; Phone (402) 534-2321; Fax (402) 534-2291;
E-mail: ken.booth@centennialbroncos.org
Applications will be accepted through February 24, 2020. AA/EOE

